                          dataDeNascimento +
                          endereco +
                          cpf +
                          whatsapp
                      ),
                    console.log(registers))
                  } */
                >
                  Próximo
                </button>
              </Link>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
